import React, { Component } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
  width: '100%',
  height: '50%',
  position: 'absolute'
};

export class MapContainer extends Component {
  myLatLng = new google.maps.LatLng(this.props.lattitude, this.props.longitude)
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={12}
        style={mapStyles}
        center={myLatLng}
      />
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyD8UWoPDZssIjtLLe_ogggrymmRyrg_71E'
})(MapContainer);
